import React from 'react'
import './Course.css';

const Course = () => {
  return (
    <div className='he'>
      <div className='ha'>
      <h3>COURSES</h3>
      </div>
      <div className='hea'>
      <h4>BTech Courses offering by cochin university</h4>
    </div>
    </div>
  )
}

export default Course
